const ButtonGoogle = ({text= "Sign up with goo"}) => {
    return (
        <button className="flex items-center justify-center w-full py-4 mb-5 font-semibold border gap-x-3 border-strock rounded-xl text-text2 dark:text-white dark:border-darkStroke">
        <img srcSet="/icon-google.png 2x" alt="icon-google" />
        <span>Sign up with google</span>
      </button>

    );
};

export default ButtonGoogle;
